export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},vOYQjIopsd:{data:{id:2655,attributes:{imdbId:"tt0280380",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYWVlOTBkMjQtYzRkNS00OWFhLThkOTYtOGM5MzRlM2FlYTNlL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"},{Source:"Rotten Tomatoes",Value:"17%"},{Source:"Metacritic",Value:"42\u002F100"}],item_lang:{data:{id:3318,attributes:{title:"Trapped",plot:"When their daughter is abducted and taken for ransom by a gang of serial kidnappers, a young doctor and his wife find themselves held hostage while a 24-hour plan to extort their money is set into motion. Now, with time running out and the health of their asthmatic daughter at serious risk, they find themselves in a life-and-death race against the clock as the \"perfect crime\" begins spiraling towards an unthinkable, terrifying and deadly conclusion.",slug:"trapped"}}},books:{data:[{id:12700,attributes:{title:g,description:h,thumbnail:i,authors:[a],firstBook:true,published:j,publisher:k,subtitle:l}},{id:12701,attributes:{title:g,description:h,thumbnail:i,authors:[a],firstBook:c,published:j,publisher:k,subtitle:l}},{id:12702,attributes:{title:"Third Degree",description:"“A keep-you-engaged-to-the-very-last-page thriller” (USA TODAY) from New York Times bestselling author Greg Iles—an unforgettable plunge into a world of sex, violence, marital betrayal, medical malpractice, and Southern intrigue…all of which takes place in one furious, terrifying day. In the span of twenty-four hours, everything Laurel Shields believes about her life and her marriage to a prominent doctor will be shattered—if she survives a terrifying ordeal. The day begins with the jarring discovery that, soon after ending an affair, Laurel is pregnant. But when she returns home to find her husband ashen, unkempt, and on the brink of violence, a nightmare quickly unfolds. In the heart of an idyllic Mississippi town, behind the walls of her perfect house, Laurel is locked in a volatile standoff with a husband she barely recognizes. Confronted by evidence of her betrayal, she must tread a deadly path between truth and deception while a ring of armed police prepares a dangerous rescue. But Laurel’s only hope lies with her former lover, a man whom fate has granted the power to save both Laurel and her children—if she can protect his identity long enough...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=vEnnDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2020-05-26",publisher:"Pocket Books",subtitle:d}},{id:12703,attributes:{title:"Blood Memory",description:"From the author of the New York Times bestselling Natchez Burning trilogy and the Penn Cage series, and hailed by Dan Brown (The Da Vinci Code) for his “utterly consuming” suspense fiction, Greg Iles melds forensic detail with penetrating insight in this novel that delves in the heart of a killer in a Mississippi town. Some memories live deep in the soul, indelible and dangerous, waiting to be resurrected… Forensic dentist “Cat” Ferry is suspended from an FBI task force when the world-class expert is inexplicably stricken with panic attacks and blackouts while investigating a chain of brutal murders. Returning to her Mississippi hometown, Cat finds herself battling with alcohol, plagued by nightmares, and entangled with a married detective. Then, in her childhood bedroom, some spilled chemicals reveal two bloody footprints…and the trauma of her father’s murder years earlier comes flooding back. Facing the secrets of her past, Cat races to connect them to a killer’s present-day violence. But what emerges is the frightening possibility that Cat herself might have blood on her hands… “As Southern Gothic as it gets” (Kirkus Reviews), Greg Iles’s Blood Memory “will have readers turning pages at a breakneck pace” (New Orleans Times-Picayune).",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=A86MDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2019-04-09",publisher:"Scribner",subtitle:d}},{id:12704,attributes:{title:"The Devil's Punchbowl",description:"A deep river pit in Natchez, Mississippi, reputed to be the hiding spot for Jean Lafitte's hidden treasure and a dumping ground for numerous murder victims, becomes the site of a dangerous showdown for Penn Cage, in a tale beset by racial tension, betrayals and illicit sex. By the author of Third Degree. Reprint.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cqy7vMVhLgAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2011-12-06",publisher:"Simon and Schuster",subtitle:d}}]}}},meta:{}}},prerenderedAt:1681377174634}}("Greg Iles","movie",null,"A Novel","series",1,"24 Hours","#1 New York Times bestselling author Greg Iles takes readers on a daringly executed roller-coaster ride as a family under attack takes justice into their own hands. It begins on a perfect night, with a perfect family about to be trapped in a perfect crime... Will Jennings is a successful young doctor in Jackson, Mississippi, with a thriving practice, a beautiful wife, and a five-year-old daughter he loves beyond measure. But Will and his family are being watched by a con man and psychopath who may be a genius. A man who has never been caught and whose victims have never talked to the police. A man whose life's work strikes at the heart of every family's unspoken fear: the unstoppable kidnapping. But this time he's picked the wrong family to terrorize. Because Will and Karen Jennings aren't going to watch helplessly as he victimizes them. They aren't going to let him get away with it. They're going to fight back...","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_BkG2qSIcLMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2001-06-01","Penguin","A Suspense Thriller"))